  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:18.875122\",\n\t\"name\": \"stillwater-wildlife-management-area-annual-narrative-report-1987\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Fallon, Stillwater and Anaho Island
  National Wildlife Refuges are located in northwest Nevada and are administered by
  the refuge administrative office in Fallon, Nevada. Together they comprise the Stillwater
  Wildlife Management Area (SWMA). The weather in 1987 was average, other than a hot
  summer. An agreement was made with the Fallon Paiute-Shoshone Tribes regarding collection,
  excavation, temporary storage and some scientific analysis of human remains. Contaminated
  water continues to be a big refuge issue involving many different agencies. Approximately
  320,405 AF of water was released below Lahontan Reservoir; Stillwater WMA received
  about 42,165 AF. Only a trickle of water actually reached the mouth of the Carson
  Sink, probably less than 1000 AF. The reduced flows to wetlands began to seriously
  impact for the quality and quantity of the wetlands. Excellent habitat was provided,
  however, for wintering waterfowl. Because of the high salt content, wind action,
  and springs the Carson Sink never froze. Somewhere between 5,000-30-000 wintered
  at the mouth of the Carson River.  For the second year American White Pelicans wintered
  at Stillwater. It was a bad year for migratory bird disease and die-offs. Avian
  Cholera and Botulism were both present.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
